At the moment I can change the log format for function logging, but unfortunately cannot overwrite log formatting into a console for host, unlike the **in-process** function.
## Steps to reproduce: 
### Prerequisites
- Linux docker container
- .NET 6 Isolated Function.
- `Program.cs` file setup ⬇️
```csharp
await new HostBuilder()
    .ConfigureFunctionsWorkerDefaults(builder =>
    {
        builder.Services.AddLogging(provider =>
        {
            provider.ClearProviders();
            provider.AddJsonConsole();
        });
    })
    .ConfigureAppConfiguration(builder =>
    {
        builder.AddJsonFile("host.json");
        builder.AddJsonFile("work.settings.json");
    })
    .ConfigureServices((context, services) =>
    {
        
        services.AddLogging(builder =>
        {
        });
    })
    .Build()
    .RunAsync();
```

---
Actual log message in console:
```
info: Host.Function.Console[0]
      {"EventId":0,"LogLevel":"Error","Category":"MyTestServiceFunc.HealthFunction","Message":"Test works perfectly :). Some random number: 550","State":{"Message":"Test works perfectly :). Some random number: 550","0":550,"{OriginalFormat}":"Test works perfectly :). Some random number: {0}"}}
```
Expected log message:
```
{"EventId":0,"LogLevel":"Error","Category":"MyTestServiceFunc.HealthFunction","Message":"Test works perfectly :). Some random number: 987","State":{"Message":"Test works perfectly :). Some random number: 987","0":987,"{OriginalFormat}":"Test works perfectly :). Some random number: {0}"}}
```
---
So the main difference is in this line: `info: Host.Function.Console[0]` which brakes our logging agent which reads logs from container console (stdout) in JSON format only.

I would like to write middleware for `[EventGridTrigger]` functions that receive a `CloudEvent`. In the middleware I'd like to read an extension attribute and do something with that. However the only way I seem to be able to get anything about the incoming `CloudEvent` is via `context.BindingContext.BindingData`, and this only contains the `data` property of the CloudEvent and no other properties or extension attributes.

Is there a way to do this that I'm missing? Example of something I was hoping to be able to do:

```C#
 var host = new HostBuilder()
     .ConfigureFunctionsWorkerDefaults(builder =>
     {
         builder.UseMiddleware((context, next) =>
         {
             if (context.FunctionDefinition.InputBindings["cloudEvent"].Type == "eventGridTrigger")
             {
                 Console.WriteLine($"myExtensionAttribute: {context.BindingContext.BindingData["myExtensionAttribute"]}");
             }

             return next();
         });
     })
     .Build();

 await host.RunAsync();
```

## Summary
If the name of a function class is the same with the namespace **AND** the project it resides in, enabling `FunctionsEnableExecutorSourceGen` will generate the following build error in generated source code:
> The type name 'Name' does not exist in the type 'Name'

## Minimal reproducible sample
In a project named `FunctionCodeGen`:
```cs
using System.Net;
using Microsoft.Azure.Functions.Worker;
using Microsoft.Azure.Functions.Worker.Http;

namespace FunctionCodeGen
{
    public class FunctionCodeGen
    {
        [Function("FunctionCodeGen")]
        public HttpResponseData Run([HttpTrigger(AuthorizationLevel.Function, "get")] HttpRequestData req) => req.CreateResponse(HttpStatusCode.OK);
    }
}
```
```xml
<Project Sdk="Microsoft.NET.Sdk">
  <PropertyGroup>
    <TargetFramework>net6.0</TargetFramework>
    <AzureFunctionsVersion>v4</AzureFunctionsVersion>
    <OutputType>Exe</OutputType>
    <ImplicitUsings>enable</ImplicitUsings>
    <Nullable>enable</Nullable>
    <FunctionsEnableExecutorSourceGen>True</FunctionsEnableExecutorSourceGen>
  </PropertyGroup>
  <ItemGroup>
    <PackageReference Include="Microsoft.Azure.Functions.Worker" Version="1.19.0" />
    <PackageReference Include="Microsoft.Azure.Functions.Worker.Extensions.Http" Version="3.1.0" />
    <PackageReference Include="Microsoft.Azure.Functions.Worker.Sdk" Version="1.15.1" />
  </ItemGroup>
  <ItemGroup>
    <None Update="host.json">
      <CopyToOutputDirectory>PreserveNewest</CopyToOutputDirectory>
    </None>
    <None Update="local.settings.json">
      <CopyToOutputDirectory>PreserveNewest</CopyToOutputDirectory>
      <CopyToPublishDirectory>Never</CopyToPublishDirectory>
    </None>
  </ItemGroup>
  <ItemGroup>
    <Using Include="System.Threading.ExecutionContext" Alias="ExecutionContext" />
  </ItemGroup>
</Project>
```

## Analysis
The generated code causing error is:
```cs
namespace FunctionCodeGen
{
    // ...
    internal class DirectFunctionExecutor : IFunctionExecutor
    {
        // ...
        public async ValueTask ExecuteAsync(FunctionContext context)
        {
            // ...
            var i = _functionActivator.CreateInstance(instanceType, context) as FunctionCodeGen.FunctionCodeGen; // This line causes error
            // ...
        }
        // ...
    }
    // ...
}
```

The namespace for the generated class is determined by the project name. When project name and the namespace for the function class are the same, the generated class and the function class reside in the same namespace. If additionally the function class has the same name with the containing namespace, then the compiler interprets the generated `as FunctionCodeGen.FunctionCodeGen` as referencing a nested type called `FunctionCodeGen` within type `FunctionCodeGen`, which does not exist.

Renaming the project will change the namespace for the generated class, so the compiler will be able to tell that `as FunctionCodeGen.FunctionCodeGen` references a class called `FunctionCodeGen` in another namespace `FunctionCodeGen`, and the code compiles. Renaming either the namespace or the function class will change `as FunctionCodeGen.FunctionCodeGen` to something like `as FunctionCodeGenNamespace.FunctionCodeGenClass`, and the compiler will be able to tell the first token is a namespace and the second one is a class, avoiding the problem.

